import React, { Component } from 'react';
import { Container, Jumbotron } from 'react-bootstrap';
import NavBar from './components/NavBar';

class App extends Component {
  state = {};
  render() {
    return (
      <div>
        <NavBar />
        <Jumbotron>
          <Container>
            <h1>Best Bank</h1>
          </Container>
        </Jumbotron>
        <Container className="container border border-white rounded rounded-sm bg-white pt-4">
          <h1>Expected returns</h1>
        </Container>
      </div>
    );
  }
}

export default App;
